import React from 'react';
import { Link } from 'react-router-dom';

const nav = {

}

const navLogo = {

}

const navLinks = {

}

const links = {

}

const linkText = {

}

function BottomNav() {
    return (
        <div className="bottomNav">
            <nav style={ nav }>
                <Link style={{maxHeight: 'inherit', height: 'inherit'}} to='/'>
                    <img src="/images/navLogo.png" alt="CBSI" style={ navLogo }/>
                </Link>
                    <ul style={ navLinks }>
                        <Link style={links} to='/'>
                            <LinkText>HOME</LinkText>
                        </Link>
                        <Link style={links} to='/about'>
                            <LinkText>ABOUT</LinkText>
                        </Link>
                        <Link style={links} to='/services'>
                            <LinkText>SERVICES</LinkText>
                        </Link>
                        <Link style={links} to='/projects'>
                            <LinkText>OUR PROJECTS</LinkText>
                        </Link>
                        <Link style={links} to='/contact'>
                            <LinkText>CONTACT</LinkText>
                        </Link>
                    </ul>
            </nav>
        </div>
    );
}

export default BottomNav;
